function ImageAnimation(imgSelector, divSelector, imgTransformY, divtransformY) {
  gsap.utils.toArray(imgSelector).forEach((box) => {
    gsap.set(box, {
      y: imgTransformY,

    });
    gsap.to(box, {
      ease: 'power1.out',
      scrollTrigger: {
        trigger: box,
        markers: false,
        scrub: 3,
        start: "0% 100%",
        end: "100% 50%",
      },
      y: 0,
    });
  });
  gsap.utils.toArray(divSelector).forEach((box) => {
    gsap.set(box, {
      y: divtransformY,

      ease: 'power1.out',
    });
    gsap.to(box, {
      scrollTrigger: {
        trigger: box,
        markers: false,
        scrub: 1,
        start: "0 80%",
        end: "100% 30%"
      },
      ease: 'power1.out',
      y: 0,

    });
  });
}
