function sliderAnimation() {
  const doc = this.getSVGDocument();
  const selcetor = doc.querySelectorAll("svg path");

  function AnimationSVG() {
    gsap.from(selcetor, {
      opacity: 0,
      scaleX: 0.5,
      scaleY: 0.5,
      transformOrigin: "center",
      stagger: { // wrap advanced options in an object
        each: 0.05,
        from: "end",
        ease: "power2.inOut",
      }
    });
  }

  ScrollTrigger.create({
    trigger: '.adventure-slider',
    start: () => 'top 85%',
    end: () => 'top 85%',
    // markers:true,
    onEnter: () => {
      AnimationSVG();
    },
  });
  // $(".slick-arrow").click(function(){
  //   AnimationSVG();
  // });

  $(".adventure-slider").on("beforeChange", function (){
setTimeout(() => {
  AnimationSVG();
}, 3000);

    // alert("red");
  })

}

function HowItWork() {
  const doc = this.getSVGDocument();
  const selcetor = doc.querySelectorAll("svg>*");

  function AnimationSVG() {
    gsap.from(selcetor, {
      opacity: 0,
      scaleX: 0.5,
      scaleY: 0.5,
      transformOrigin: "center",
      stagger: { // wrap advanced options in an object
        each: 0.30,
        from: "end",
        ease: "power2.inOut",
      }
    });
  }
  ScrollTrigger.create({
    trigger: '.howitworksec',
    start: () => 'top 80%',
    end: () => 'top 80%',
    // markers:true,
    onEnter: () => {

      AnimationSVG();
    },
  })
}
function PlaningSvg() {
  const doc = this.getSVGDocument();
  const selcetor = doc.querySelectorAll("svg clipPath,svg g");

  function AnimationSVG() {
    gsap.from(selcetor, {
      opacity: 0,
      scaleX: 0.5,
      scaleY: 0.5,
      transformOrigin: "center",
      stagger: { // wrap advanced options in an object
        each: 0.08,
        from: "end",
        ease: "power2.inOut",
      }
    });
  }
  ScrollTrigger.create({
    trigger: '.planning',
    start: () => 'top 80%',
    end: () => 'top 80%',
    markers:false,
    onEnter: () => {

      AnimationSVG();
    },
  })
}
function Grid(Select) {
  const selcetor = document.querySelectorAll(Select);
  ScrollTrigger.batch(selcetor, {
    onEnter: elements => {
      gsap.from(elements, {
        autoAlpha: 0,
        y: 60,
        stagger: 0.15
      });
    },
    // once: true
  });
}
Grid(".grid>div");
Grid(".place-block>a");
Grid(".liveanywhere .detail-link");

