function SlideDown(selector) {
  const select2 = document.querySelectorAll(selector);
  gsap.utils.toArray(select2).forEach((slidedown) => {
    gsap.set(slidedown, {
      x: "0%",
      y: "-40",
      opacity:0.8,
    });
    gsap.to(slidedown, {
      scrollTrigger: {
        trigger: slidedown,
        scrub: 4,
        // markers: true,
        start: "top 80%",
        end: "bottom 80%",
      },
      x: "0",
      y: "0",
      opacity:1,
    });

  });
}
// SlideDown("header");
// SlideDown("section");
SlideDown(".memory-content");
SlideDown(".subscription.slidown");
SlideDown(".video");

// ================
// Fade up
// ================
function Fadedown(selector) {
  const select2 = document.querySelectorAll(selector);
  gsap.utils.toArray(select2).forEach((slidedown) => {
    gsap.set(slidedown, {
      x: "0%",
      y: "-10",
      scale:0,
      opacity:0,

    });
    gsap.to(slidedown, {
      scrollTrigger: {
        trigger: slidedown,
        scrub: 4,
        // markers: true,
        start: "top 80%",
        end: "bottom 80%",
      },
      scale:1,
      x: "0",
      y: "0",
      opacity:1,
    });

  });
}

