var video = document.getElementById("myVideo");
var btn = document.getElementById("play");
$("#play").click(function(e){

  if (video.paused) {
    video.play();
    $("#play .bx-pause").show();
    $("#play .bx-play").hide();
    $(".ply-btn").addClass("play");
  } else {
    video.pause();
    $("#play .bx-pause").hide();
    $("#play .bx-play").show();
    $(".ply-btn").removeClass("play");
  }
});
